import Home from "./screens/Home";
import { BrowserRouterRouter, Routes, Route } from "react-router-dom";
function App() {
  return (
    <>
      <BrowserRouter>
      <div>
        <Routes>
          <Route path="/" element={<Home/>}>

          </Route>
        </Routes>
        </div>
      </BrowserRouter>
    </>
  );
}

export default App;
